import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import QuizPlayer from './components/QuizPlayer';
import CaseBrowser from './components/CaseBrowser';

import { authAPI, userAPI, casesAPI } from './services/api';
import styles from './styles/QuizPlayer.module.css';

const App = () => {
  const [user, setUser] = useState(null);
  const [quizConfig, setQuizConfig] = useState(null);
  const [showQuiz, setShowQuiz] = useState(false);
  const [showCaseBrowser, setShowCaseBrowser] = useState(false);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    checkAuthStatus();
  }, []);

  const checkAuthStatus = async () => {
    const token = localStorage.getItem('token');
    if (token) {
      try {
        const response = await userAPI.getProfile();
        setUser(response.data);
      } catch (err) {
        localStorage.removeItem('token');
      }
    }
  };

  const handleLogin = async (credentials) => {
    setLoading(true);
    setError(null);

    try {
      const response = await authAPI.login(credentials);
      localStorage.setItem('token', response.data.access_token);
      const userResponse = await userAPI.getProfile();
      setUser(userResponse.data);
    } catch (err) {
      setError('Login failed. Please check your credentials.');
      console.error('Login error:', err);
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = async () => {
    try {
      await authAPI.logout();
    } catch (err) {
      console.error('Logout error:', err);
    } finally {
      localStorage.removeItem('token');
      setUser(null);
      setQuizConfig(null);
      setShowQuiz(false);
    }
  };

  const startQuiz = (config) => {
    setQuizConfig(config);
    setShowQuiz(true);
  };

  const handleQuizComplete = (results) => {
    console.log('Quiz completed:', results);
    setShowQuiz(false);
    setQuizConfig(null);
  };

  const handleQuizExit = () => {
    setShowQuiz(false);
    setQuizConfig(null);
  };

  const openCaseBrowser = () => {
    setShowCaseBrowser(true);
  };

  const closeCaseBrowser = () => {
    setShowCaseBrowser(false);
  };

  const QuizConfigForm = () => {
    const [categories, setCategories] = useState([]);

    const [config, setConfig] = useState({
      difficulty: 'medium',
      category: 'all',
      num_questions: 10,
      time_per_question: 60,
      adaptive_mode: false
    });

    useEffect(() => {
      const loadCategories = async () => {
        try {
          const response = await casesAPI.getCategories();
          setCategories(response.data.categories || []);
        } catch (err) {
          console.error('Failed to load categories:', err);
          // Fallback to hardcoded categories if API fails
          setCategories([
            'Neurodevelopmental Disorders',
            'Schizophrenia Spectrum and Other Psychotic Disorders',
            'Bipolar and Related Disorders',
            'Depressive Disorders',
            'Anxiety Disorders',
            'Obsessive-Compulsive and Related Disorders',
            'Trauma- and Stressor-Related Disorders',
            'Dissociative Disorders',
            'Somatic Symptom and Related Disorders',
            'Feeding and Eating Disorders',
            'Elimination Disorders',
            'Sleep-Wake Disorders',
            'Sexual Dysfunctions',
            'Gender Dysphoria',
            'Disruptive, Impulse-Control, and Conduct Disorders',
            'Substance-Related and Addictive Disorders',
            'Neurocognitive Disorders',
            'Personality Disorders',
            'Paraphilic Disorders'
          ]);
        }
      };
      loadCategories();
    }, []);

    const handleSubmit = (e) => {
      e.preventDefault();
      startQuiz(config);
    };

    return (
      <div className={styles.container}>
        <div className={styles.header}>
          <h1 className={styles.title}>Diagnosis Quiz Tool</h1>
          <p className={styles.subtitle}>Test your medical diagnosis skills</p>
            <div className={styles.navigation}>
              <Link to="/cases" className={styles.navLink}>
                Browse Cases
              </Link>
            </div>
        </div>

        <div className={styles.quizContainer}>
          <div className={styles.questionContainer}>
            <h2>Quiz Configuration</h2>

            {error && (
              <div className={styles.error}>
                {error}
              </div>
            )}

            <form onSubmit={handleSubmit} className={styles.quizForm}>
              <div className={styles.formGroup}>
                <label htmlFor="difficulty">Difficulty Level:</label>
                <select
                  id="difficulty"
                  value={config.difficulty}
                  onChange={(e) => setConfig({...config, difficulty: e.target.value})}
                  className={styles.formControl}
                >
                  <option value="easy">Easy</option>
                  <option value="medium">Medium</option>
                  <option value="hard">Hard</option>
                  <option value="mixed">Mixed</option>
                </select>
              </div>

               <div className={styles.formGroup}>
                 <label htmlFor="category">Category:</label>
                 <select
                   id="category"
                   value={config.category}
                   onChange={(e) => setConfig({...config, category: e.target.value})}
                   className={styles.formControl}
                 >
                   <option value="all">All Categories</option>
                   {categories.map(category => {
                     const isObject = typeof category === 'object';
                     const value = isObject ? category.name : category;
                     const display = isObject ? `${category.display_name} (${category.case_count})` : category;
                     return (
                       <option key={value} value={value}>
                         {display}
                       </option>
                     );
                   })}
                 </select>
               </div>

              <div className={styles.formGroup}>
                <label htmlFor="num_questions">Number of Questions:</label>
                <input
                  id="num_questions"
                  type="number"
                  min="1"
                  max="50"
                  value={config.num_questions}
                  onChange={(e) => setConfig({...config, num_questions: parseInt(e.target.value)})}
                  className={styles.formControl}
                />
              </div>

              <div className={styles.formGroup}>
                <label htmlFor="time_per_question">Time per Question (seconds):</label>
                <input
                  id="time_per_question"
                  type="number"
                  min="10"
                  max="300"
                  value={config.time_per_question}
                  onChange={(e) => setConfig({...config, time_per_question: parseInt(e.target.value)})}
                  className={styles.formControl}
                />
              </div>

              <div className={styles.formGroup}>
                <label className={styles.checkboxLabel}>
                  <input
                    type="checkbox"
                    checked={config.adaptive_mode}
                    onChange={(e) => setConfig({...config, adaptive_mode: e.target.checked})}
                    className={styles.checkbox}
                  />
                  Adaptive Mode (difficulty adjusts based on performance)
                </label>
              </div>

              <div className={styles.quizControls}>
                <button type="submit" className={styles.buttonPrimary} disabled={loading}>
                  {loading ? 'Starting Quiz...' : 'Start Quiz'}
                </button>
              </div>
            </form>
          </div>
        </div>
      </div>
    );
  };

  return (
    <Router>
      <Routes>
        <Route path="/" element={<QuizConfigForm />} />
        <Route path="/quiz" element={
          showQuiz && quizConfig ? (
            <QuizPlayer
              quizConfig={quizConfig}
              onQuizComplete={handleQuizComplete}
              onQuizExit={handleQuizExit}
              userId={user?.id}
            />
          ) : (
            <Navigate to="/" replace />
          )
        } />
        <Route path="/cases" element={
          <CaseBrowser
            userId={user?.id}
            onExit={() => window.history.back()}
          />
        } />
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </Router>
  );
};

export default App;
